import React from 'react';

const MakeAdmin = () => {
    return (
        <section className="container-fluid row" >
        <div className="col-md-2">
            <AdminSidebar></AdminSidebar>
        </div>
        <div className="col-md-10">
            <div className="ml-5">
                <h5 className="text-brand pb-2">Service list</h5>
      

            </div>
        </div>
    </section>
    );
};

export default MakeAdmin;
